import React from "react";

import { Text, View, StyleSheet } from "@react-pdf/renderer";
const styles = StyleSheet.create({
  container: {
    marginBottom: 10,
    display:"flex",
    flexWrap:"wrap",
  },
  text: {
    fontSize: 10,
    flexWrap:"wrap"
  },
  title: {
    fontSize: 16,
    marginBottom: 4,
    textTransform: "uppercase",
    color: "#536DFE",
  },
});

export default ({ about ="" }) => (
  <View style={styles.container}>
    <Text style={styles.title}>About</Text>
    <Text style={styles.text} break>
      Duis duis fugiat ullamco fugiat in.Ullamco veniam ex sunt anim veniam sint
      dolor anim ea labore elit. Eiusmod quis voluptate cillum quis. Ipsum
      consequat minim reprehenderit aliquip exercitation.
    </Text>
  </View>
);
